import { Box, Button } from '@mui/material';
import React from 'react';
import {FormControl,TextField} from '@mui/material';
import { makeStyles } from '@mui/styles';

const style = makeStyles({
  button:{
    color:'red'
  },
  label:{
  },
  form:{
    display:'flex',
    flexDirection:'column'
  },
  inputBox:{
    width:'200px'
  }
})

export default function SignupComponent() {
  const classes = style()
  return (
   <div>
    <form className={classes.form}>
      <label>Name</label><input type="text" className={classes.inputBox}></input>
      <label>Password</label><input type='password' className={classes.inputBox}></input>
      <label>Mobile Number</label><input type='tel' className={classes.inputBox}></input>
      <button type='submit' className={classes.button}>Submit</button>
    </form>
   </div>
  )
}
